import React from "react";
class Ma extends React.Component(){
    constructor(){
        super();
        this.state.props={
            name:"naveen yakkaluru",
            role:"front end developer",
            company:"tata company",
            salary:25000
        }
    }
    render(){
        return(
            <div>
                {this.state.props.name}<br/>
                {this.state.role}<br/>
                {this.state.company}<br/>
                {this.state.salary}<br/>

                <button>click</button>

            </div>
        )
    }
}
export default Ma;
